import React from 'react';
import s from './../Dialogs.module.css';


const Message = (props) => {
    return(
        <div className={s.message}>
            <div>{props.message}</div>
            <div>
                <textarea cols="80" rows="3"></textarea>
            </div>
        </div>
    )
}


export default Message;
